import * as types from './ActionTypes';

export function getCourses(posts) {
    return {
        type: types.GET_COURSES,
        posts
    };
}

export function getCourseSuccess(data) {
    return {
        type: types.GET_COURSES_SUCCESS,
        data
    }
};
